Back home after an amazing week at @superballlive !! I came second in the world which is my best result so far! There was so much unseen work I’ve put in this year to reach this level, so whether the people see it or not, I’m extremely proud of my result. I know how much work went into this, so seeing that pay off is honestly the best feeling more than anything else. Despite losing the final I still have so much motivation and see clearly what I have to work on. I always come back with more😘

 @jessemarlet Congratulations❤️ I am so proud of you man and so happy to see you achieve your goal. It’s an honor to share the podium with you and @fagerlibrothers Let’s keep pushing and see how far we can take it.

Thanks everyone for all the messages. The support means so much. I’ll see you in the next one.
